import React, {useState} from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import Axios from "axios";


function Form({dash}){

  return(
      <div class="card" style={{width: "18rem"}}>
      <img src={`${dish.dish_img}`} class="card-img-top" alt="dish-img" />
      <div class="card-body">
        <h5 class="card-title">{`${dish.dish_name}`}</h5>
        <p class="card-text">{`${dish.dish_ingredients}`}</p>
        <p class="card-text">{`${dish.dish_price}`}</p>
        <p class="card-text">{`${dish.dish_description}`}</p>
        <p class="card-text">{`${dish.dish_category}`}</p>
        <button type="button" className="btn btn-success" style={{margin:"10px"}}>Add</button>
        <button type="button" className="btn btn-success" style={{margin:"10px"}}>Delete</button>
      </div>
    </div>
  )

}


export default Form;
